import React, { Component } from 'react';
import axios from 'axios';

class Store extends Component {
    state = {
        storeName: null,
        
    }

    componentDidMount() {
        console.log(this.props.match.params.storeId);
        
        axios.get('')
            .then(Response => {
                this.setState();
            })
            .catch(error => console.log(error))
    }

    render() {
        return(
            <div></div>
        );
    }
}

export default Store;
